0441\u043a\u043e<\/a> \u0438 \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u044d\u0442\u043e\u0442 \u0431\u0435\u0440\u0435\u0433 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u043c \u0432\u043b\u0430\u0434\u0435\u043d\u0438\u0435\u043c (\u00ab\u041d\u043e\u0432\u044b\u0439 \u0410\u043b\u044c\u0431\u0438\u043e\u043d\u00bb).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1789_%D0%B3%D0%BE%D0%B4\" title=\"1789 \u0433\u043e\u0434\">1789<\/a>&#160;\u2014 \u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a> \u0434\u0435\u043f\u0443\u0442\u0430\u0442\u044b \u0442\u0440\u0435\u0442\u044c\u0435\u0433\u043e \u0441\u043e\u0441\u043b\u043e\u0432\u0438\u044f \u0413\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0445 \u0448\u0442\u0430\u0442\u043e\u0432, \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u0430\u043d\u043d\u044b\u0435 \u043d\u0438\u0437\u0448\u0438\u043c\u0438 \u0441\u043b\u043e\u044f\u043c\u0438 \u0434\u0443\u0445\u043e\u0432\u0435\u043d\u0441\u0442\u0432\u0430 \u0438 \u0434\u0432\u043e\u0440\u044f\u043d\u0441\u0442\u0432\u0430, \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0441\u0438\u043b\u0438 \u0441\u0435\u0431\u044f \u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u043c \u0441\u043e\u0431\u0440\u0430\u043d\u0438\u0435\u043c. \u041f\u043e\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0432\u0448\u0430\u044f \u043f\u043e\u043f\u044b\u0442\u043a\u0430 \u0440\u0430\u0437\u0433\u043e\u043d\u0430 \u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0441\u043e\u0431\u0440\u0430\u043d\u0438\u044f \u043f\u0440\u0438\u0432\u0435\u043b\u0430 \u043a \u043d\u0430\u0440\u043e\u0434\u043d\u043e\u043c\u0443 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u044e 13\u201414 \u0438\u044e\u043b\u044f, \u0432\u0437\u044f\u0442\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D1%81%D1%82%D0%B8%D0%BB%D0%B8%D1%8F\" title=\"\u0411\u0430\u0441\u0442\u0438\u043b\u0438\u044f\">\u0411\u0430\u0441\u0442\u0438\u043b\u0438\u0438<\/a> \u0438 \u043f\u043e\u0431\u0435\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B0%D1%8F_%D1%84%D1%80%D0%B0%D0%BD%D1%86%D1%83%D0%B7%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u0430\u044f \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0430\u044f \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0439 \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u0438<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1850_%D0%B3%D0%BE%D0%B4\" title=\"1850 \u0433\u043e\u0434\">1850<\/a>&#160;\u2014 \u043d\u0430 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u043c \u0441\u0443\u0434\u043d\u0435 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=SS_G._P._Griffith&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"SS G. P. Griffith (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u00ab\u0413. \u041f. \u0413\u0440\u0438\u0444\u0444\u0438\u0442\u00bb<\/a>  \u0432\u043e\u0437\u043d\u0438\u043a \u043f\u043e\u0436\u0430\u0440, \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u043f\u043e\u0433\u0438\u0431\u043b\u043e \u0434\u043e 289 \u0447\u0435\u043b\u043e\u0432\u0435\u043a .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1856_%D0%B3%D0%BE%D0%B4\" title=\"1856 \u0433\u043e\u0434\">1856<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B8%D0%BB%D0%B0%D0%B4%D0%B5%D0%BB%D1%8C%D1%84%D0%B8%D1%8F\" title=\"\u0424\u0438\u043b\u0430\u0434\u0435\u043b\u044c\u0444\u0438\u044f\">\u0424\u0438\u043b\u0430\u0434\u0435\u043b\u044c\u0444\u0438\u0438<\/a> \u043e\u0442\u043a\u0440\u044b\u043b\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 \u0441\u044a\u0435\u0437\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_(%D0%A1%D0%A8%D0%90)\" title=\"\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f (\u0421\u0428\u0410)\">\u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0439 \u043f\u0430\u0440\u0442\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1863\" class=\"mw-redirect\" title=\"1863\">1863<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BF%D1%80%D0%B8_%D0%AD%D0%BB%D0%B4%D0%B8\" title=\"\u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u042d\u043b\u0434\u0438\">\u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u042d\u043b\u0434\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1866_%D0%B3%D0%BE%D0%B4\" title=\"1866 \u0433\u043e\u0434\">1866<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%BE-%D0%BF%D1%80%D1%83%D1%81%D1%81%D0%BA%D0%BE-%D0%B8%D1%82%D0%B0%D0%BB%D1%8C%D1%8F%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0410\u0432\u0441\u0442\u0440\u043e-\u043f\u0440\u0443\u0441\u0441\u043a\u043e-\u0438\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0410\u0432\u0441\u0442\u0440\u043e-\u043f\u0440\u0443\u0441\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1876_%D0%B3%D0%BE%D0%B4\" title=\"1876 \u0433\u043e\u0434\">1876<\/a>&#160;\u2014 \u043c\u0438\u043d\u0438\u0441\u0442\u0435\u0440\u0441\u0442\u0432\u043e \u0432\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u0438\u0445 \u0434\u0435\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a> \u0437\u0430\u043f\u0440\u0435\u0442\u0438\u043b\u043e \u043f\u0435\u0447\u0430\u0442\u0430\u0442\u044c \u0443\u0447\u0435\u0431\u043d\u044b\u0435 \u0438 \u043d\u0430\u0443\u0447\u043d\u043e-\u043f\u043e\u043f\u0443\u043b\u044f\u0440\u043d\u044b\u0435 \u043a\u043d\u0438\u0433\u0438 \u043d\u0430 \u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u043e\u043c \u044f\u0437\u044b\u043a\u0435 .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1885_%D0%B3%D0%BE%D0%B4\" title=\"1885 \u0433\u043e\u0434\">1885<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a<\/a> \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0433\u043e \u043f\u0430\u0440\u043e\u0445\u043e\u0434\u0430 \u00abIsere\u00bb \u043f\u0440\u0438\u0431\u044b\u043b \u0434\u0430\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0433\u043e \u043d\u0430\u0440\u043e\u0434\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%