iki\/%D0%9C%D0%B0%D1%80%D0%B8%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B1%D0%BE%D0%BB%D1%8C%D0%BD%D0%B8%D1%86%D0%B0\" title=\"\u041c\u0430\u0440\u0438\u0438\u043d\u0441\u043a\u0430\u044f \u0431\u043e\u043b\u044c\u043d\u0438\u0446\u0430\">\u041c\u0430\u0440\u0438\u0438\u043d\u0441\u043a\u043e\u0439 \u0431\u043e\u043b\u044c\u043d\u0438\u0446\u044b<\/a>. \u0411\u044b\u043b \u0441\u043d\u0435\u0441\u0451\u043d \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1930_%D0%B3%D0%BE%D0%B4\" title=\"1930 \u0433\u043e\u0434\">1930 \u0433\u043e\u0434\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1898_%D0%B3%D0%BE%D0%B4\" title=\"1898 \u0433\u043e\u0434\">1898<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%BD%D0%B0%D1%82_%D0%A1%D0%A8%D0%90\" title=\"\u0421\u0435\u043d\u0430\u0442 \u0421\u0428\u0410\">\u0421\u0435\u043d\u0430\u0442 \u0421\u0428\u0410<\/a> \u0441\u043e\u0433\u043b\u0430\u0441\u0438\u043b\u0441\u044f \u043d\u0430 \u0430\u043d\u043d\u0435\u043a\u0441\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%B2%D0%B0%D0%B9%D0%B8\" title=\"\u0413\u0430\u0432\u0430\u0439\u0438\">\u0413\u0430\u0432\u0430\u0439\u0435\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1899_%D0%B3%D0%BE%D0%B4\" title=\"1899 \u0433\u043e\u0434\">1899<\/a>&#160;\u2014 \u0441\u043f\u0443\u0441\u043a \u043d\u0430 \u0432\u043e\u0434\u0443 \u043b\u0435\u0434\u043e\u043a\u043e\u043b\u0430-\u043f\u0430\u0440\u043e\u043c\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B9%D0%BA%D0%B0%D0%BB_(%D0%BF%D0%B0%D1%80%D0%BE%D0%BC-%D0%BB%D0%B5%D0%B4%D0%BE%D0%BA%D0%BE%D0%BB)\" title=\"\u0411\u0430\u0439\u043a\u0430\u043b (\u043f\u0430\u0440\u043e\u043c-\u043b\u0435\u0434\u043e\u043a\u043e\u043b)\">\u0411\u0430\u0439\u043a\u0430\u043b<\/a>\u00bb.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B2%D1%81%D1%82%D0%B2%D0%BE_%D0%A1%D0%B0%D0%BA%D1%81%D0%BE%D0%BD%D0%B8%D1%8F\" class=\"mw-redirect\" title=\"\u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u043e \u0421\u0430\u043a\u0441\u043e\u043d\u0438\u044f\">\u0421\u0430\u043a\u0441\u043e\u043d\u0438\u044f<\/a> \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0438\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D1%82%D0%B2%D0%B0\" title=\"\u041b\u0438\u0442\u0432\u0430\">\u041b\u0438\u0442\u0432\u0435<\/a> \u0441\u043e\u0437\u0434\u0430\u0442\u044c \u0435\u0434\u0438\u043d\u043e\u0435 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1925_%D0%B3%D0%BE%D0%B4\" title=\"1925 \u0433\u043e\u0434\">1925<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%B5%D0%BD%D0%B5%D0%B2%D0%B0\" title=\"\u0416\u0435\u043d\u0435\u0432\u0430\">\u0416\u0435\u043d\u0435\u0432\u0435<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d \u041f\u0440\u043e\u0442\u043e\u043a\u043e\u043b \u043e \u0437\u0430\u043f\u0440\u0435\u0449\u0435\u043d\u0438\u0438 \u043f\u0440\u0438\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u043d\u0430 \u0432\u043e\u0439\u043d\u0435 \u044f\u0434\u043e\u0432\u0438\u0442\u044b\u0445, \u0443\u0434\u0443\u0448\u043b\u0438\u0432\u044b\u0445 \u0438 \u0434\u0440\u0443\u0433\u0438\u0445 \u043f\u043e\u0434\u043e\u0431\u043d\u044b\u0445 \u0433\u0430\u0437\u043e\u0432 \u0438 \u0431\u0438\u043e\u0441\u0440\u0435\u0434\u0441\u0442\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1929_%D0%B3%D0%BE%D0%B4\" title=\"1929 \u0433\u043e\u0434\">1929<\/a>&#160;\u2014 \u043f\u043e\u0434 \u0437\u0430\u0433\u043e\u043b\u043e\u0432\u043a\u043e\u043c \u00ab\u041a\u043d\u0438\u0433\u0430, \u043e \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043d\u0435 \u043f\u0438\u0448\u0443\u0442\u00bb \u0432 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D1%82%D0%B5%D1%80%D0%B0%D1%82%D1%83%D1%80%D0%BD%D0%B0%D1%8F_%D0%B3%D0%B0%D0%B7%D0%B5%D1%82%D0%B0\" title=\"\u041b\u0438\u0442\u0435\u0440\u0430\u0442\u0443\u0440\u043d\u0430\u044f \u0433\u0430\u0437\u0435\u0442\u0430\">\u041b\u0438\u0442\u0435\u0440\u0430\u0442\u0443\u0440\u043d\u043e\u0439 \u0433\u0430\u0437\u0435\u0442\u0435<\/a>\u00bb \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d\u0430 \u0440\u0435\u0446\u0435\u043d\u0437\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D1%80%D0%B0%D1%81%D0%B5%D0%BD%D0%BA%D0%BE%D0%B2,_%D0%90%D0%BD%D0%B0%D1%82%D0%BE%D0%BB%D0%B8%D0%B9_%D0%9A%D1%83%D0%B7%D1%8C%D0%BC%D0%B8%D1%87\" title=\"\u0422\u0430\u0440\u0430\u0441\u0435\u043d\u043a\u043e\u0432, \u0410\u043d\u0430\u0442\u043e\u043b\u0438\u0439 \u041a\u0443\u0437\u044c\u043c\u0438\u0447\">\u0410. \u0422\u0430\u0440\u0430\u0441\u0435\u043d\u043a\u043e\u0432\u0430<\/a> \u043d\u0430 \u043a\u043d\u0438\u0433\u0443 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B2%D0%B5%D0%BD%D0%B0%D0%B4%D1%86%D0%B0%D1%82%D1%8C_%D1%81%D1%82%D1%83%D0%BB%D1%8C%D0%B5%D0%B2\" title=\"\u0414\u0432\u0435\u043d\u0430\u0434\u0446\u0430\u0442\u044c \u0441\u0442\u0443\u043b\u044c\u0435\u0432\">\u0414\u0432\u0435\u043d\u0430\u0434\u0446\u0430\u0442\u044c \u0441\u0442\u0443\u043b\u044c\u0435\u0432<\/a>\u00bb <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BB%D1%8C%D1%84,_%D0%98%D0%BB%D1%8C%D1%8F_%D0%90%D1%80%D0%BD%D0%BE%D0%BB%D1%8C%D0%B4%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0418\u043b\u044c\u0444, \u0418\u043b\u044c\u044f \u0410\u0440\u043d\u043e\u043b\u044c\u0434\u043e\u0432\u0438\u0447\">\u0418\u043b\u044c\u0438 \u0418\u043b\u044c\u0444\u0430<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2,_%D0%95%D0%B2%D0%B3%D0%B5%D0%BD%D0%B8%D0%B9_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041f\u0435\u0442\u0440\u043e\u0432, \u0415\u0432\u0433\u0435\u043d\u0438\u0439 \u041f\u0435\u0442\u0440\u043e\u0432\u0438\u0447\">\u0415\u0432\u0433\u0435\u043d\u0438\u044f \u041f\u0435\u0442\u0440\u043e\u0432\u0430<\/a>, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u0437\u0430 \u043f\u0440\u043e\u0448\u0435\u0434\u0448\u0438\u0439 \u0441 \u043c\u043e\u043c\u0435\u043d\u0442\u0430 \u0438\u0437\u0434\u0430\u043d\u0438\u044f \u0433\u043e\u0434 \u0441\u043e\u0432\u0435\u0440\u0448\u0435\u043d\u043d\u043e \u043d\u0435 \u0431\u044b\u043b\u0430 \u0437\u0430\u043c\u0435\u0447\u0435\u043d\u0430 \u043a\u0440\u0438\u0442\u0438\u043a\u0430\u043c\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1930_%D0%B3%D0%BE%D0%B4\" title=\"1930 \u0433\u043e\u0434\">1930<\/a>&#160;\u2014 \u0441 \u043a\u043e\u043d\u0432\u0435\u0439\u0435\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%BB%D0%B3%D0%BE%D0%B3%D1%80%D0%B0%D0%B4%D1%81%D0%BA%D0%B8%D0%B9_%D1%82%D1%80%D0%B0%D0%BA%D1%82%D0%BE%D1%80%D0%BD%D1%8B%D0%B9_%D0%B7%D0%B0%D0%B2%D0%BE%D0%B4\" title=\"\u0412\u043e\u043b\u0433\u043e\u0433\u0440\u0430\u0434\u0441\u043a\u0438\u0439 \u0442\u0440\u0430\u043a\u0442\u043e\u0440\u043d\u044b\u0439 \u0437\u0430\u0432\u043e\u0434\">\u0421\u0442\u0430\u043b\u0438\u043d\u0433\u0440\u0430\u0434\u0441\u043a\u043e\u0433\u043e \u0442\u0440\u0430\u043a\u0442\u043e\u0440\u043d\u043e\u0433\u043e \u0437\u0430\u0432\u043e\u0434\u0430<\/a> \u0441\u043e\u0448\u0451\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u0442\u0440\u0430\u043a\u0442\u043e\u0440.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1934_%D0%B3%D0%BE%D0%B4\" title=\"1934 \u0433\u043e\u0434\">1934<\/a>&#160;\u2014 \u043f\u0435\u0440\u0432\u044b\u0439 \u0438\u0441\u043f\u044b\u0442\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0435\u0433\u043e \u0432 \u0442\u043e \u0432\u0440\u0435\u043c\u044f \u0432 \u043c\u0438\u0440\u0435 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%9D%D0%A2-20\" title=\"\u0410\u041d\u0422-20\">\u0410\u041d\u0422-20<\/a> (\u00ab\u041c\u0430\u043a\u0441\u0438\u043c \u0413\u043e\u0440\u044c\u043a\u0438\u0439\u00bb).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1939_%D0%B3%D0%BE%D0%B4\" title=\"1939 \u0433\u043e\u0434\">1939<\/a>&#160;\u2014 \u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a> \u0432 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0439 \u0440\u0430\u0437 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 \u043f\u0443\u0431\u043b\u0438\u0447\u043d\u0430\u044f \u043a\u0430\u0437\u043d\u044c \u043d\u0430 \u0433\u0438\u043b\u044c\u043e\u0442\u0438\u043d\u0435 (\u043a\u0430\u0437\u043d\u044f\u0442 \u0441\u0435\u0440\u0438\u0439\u043d\u043e\u0433\u043e \u0443\u0431\u0438\u0439\u0446\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%B9%D0%B4%D0%BC%D0%B0%D0%BD,_%D0%AD%D0%B6%D0%B5%D0%BD\" title=\"\u0412\u0435\u0439\u0434\u043c\u0430\u043d, \u042d\u0436\u0435\u043d\">\u042d\u0436\u0435\u043d\u0430 \u0412\u0435\u0439\u0434\u043c\u0430\u043d\u0430<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1940_%D0%B3%D0%BE%D0%B4\" title=\"1940 \u0433\u043e\u0434\">1940<\/a><ul><li>\u0423 \u0441\u0435\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D1%89%D0%B5%D1%80%D1%8B_(%D0%9D%D0%B8%D0%B6%D0%B5%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)\" title=\"\u041c\u0435\u0449\u0435\u0440\u044b (\u041d\u0438\u0436\u0435\u0433\u043e\u0440\u043e\u0434\u0441\u043a\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c)\">\u041c\u0435\u0449\u0435\u0440\u044b<\/a> \u0413\u043e\u0440\u044c\u043a\u043e\u0432\u0441\u043a\u043e\u0439 \u043e\u0431\u043b\u0430\u0441\u0442\u0438 \u0432\u044b\u043f\u0430\u043b \u0434\u043e\u0436\u0434\u044c \u0438\u0437 \u0441\u0435\u0440\u0435\u0431\u0440\u044f\u043d\u044b\u0445 \u043c\u043e\u043d\u0435\u0442 XVI\u2014XVII&#160;\u0432\u0432. (\u0432\u0441\u0435\u0433\u043e \u043e\u043a\u043e\u043b\u043e \u0442\u044b\u0441\u044f\u0447\u0438 \u0448\u0442\u0443\u043a).<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D1%82%D0%B2%D0%B8%D1%8F\" title=\"\u041b\u0430\u0442\u0432\u0438\u044f\">\u041b\u0430\u0442\u0432\u0438\u044e<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D1%81%D1%82%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042d\u0441\u0442\u043e\u043d\u0438\u044f\">\u042d\u0441\u0442\u043e\u043d\u0438\u044e<\/a> \u0432\u0432\u0435\u0434\u0435\u043d\u044b \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1941_%D0%B3%D0%BE%D0%B4\" title=\"1941 \u0433\u043e\u0434\">1941<\/a>&#160;\u2014 \u043e\u0442\u0434\u0430\u043d \u043f\u0440\u0438\u043a\u0430\u0437 \u0432\u0435\u0440\u0445\u043e\u0432\u043d\u043e\u0433\u043e \u0433\u043b\u0430\u0432\u043d\u043e\u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u044f \u0432\u043e\u043e\u0440\u0443\u0436\u0451\u043d\u043d\u044b\u0445 \u0441\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f\">\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438<\/a> \u043d\u0430\u0447\u0430\u0442\u044c \u043e\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043b\u0435\u043d\u0438\u0435 \u043f\u043b\u0430\u043d\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F_%D0%91%D0%B0%D1%80%D0%B1%D0%B0%D1%80%D0%BE%D1%81%D1%81%D0%B0\" class=\"mw-redirect\" title=\"\u041e\u043f\u0435\u0440\u0430\u0446\u0438\u044f \u0411\u0430\u0440\u0431\u0430\u0440\u043e\u0441\u0441\u0430\">\u0411\u0430\u0440\u0431\u0430\u0440\u043e\u0441\u0441\u0430<\/a>\u00bb \u0441 \u0443\u0442\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/22_%D0%B8%D1%8E%D0%BD%D1%8F\" title=\"22 \u0438\u044e\u043d\u044f\">22 \u0438\u044e\u043d\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1944_%D0%B3%D0%BE%D0%B4\" title=\"1944 \u0433\u043e\u0434\">1944<\/a>&#160;\u2014 \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%84%D0%B5%D1%80%D0%B5%D0%BD%D0%B4%D1%83%D0%BC\" title=\"\u0420\u0435\u0444\u0435\u0440\u0435\u043d\u0434\u0443\u043c\">\u0440\u0435\u0444\u0435\u0440\u0435\u043d\u0434\u0443\u043c\u0430<\/a> \u0440\u0430\u0441\u0442\u043e\u0440\u0433\u043d\u0443\u0442\u0430 \u0434\u0430\u0442\u0441\u043a\u043e-\u0438\u0441\u043b\u0430\u043d\u0434\u0441\u043a\u0430\u044f \u0443\u043d\u0438\u044f, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0418\u0441\u043b\u0430\u043d\u0434\u0438\u044f\">\u0418\u0441\u043b\u0430\u043d\u0434\u0438\u044f<\/a> \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0435\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1950_%D0%B3%D0%BE%D0%B4\" title=\"1950 \u0433\u043e\u0434\">1950<\/a>&#160;\u2014 \u0447\u0438\u043a\u0430\u0433\u0441\u043a\u0438\u0439 \u0445\u0438\u0440\u0443\u0440\u0433 \u0420\u0438\u0447\u0430\u0440\u0434 \u041b\u043e\u0443\u043b\u0435\u0440 (Richard Lawler) \u0437\u0430 45 \u043c\u0438\u043d\u0443\u0442 \u0432\u044b\u043f\u043e\u043b\u043d\u0438\u043b \u043f\u0435\u0440\u0432\u0443\u044e \u0432 \u043c\u0438\u0440\u0435 \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044e \u043f\u043e \u043f\u0435\u0440\u0435\u0441\u0430\u0434\u043a\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D1%87%D0%BA%D0%B0_(%D0%B0%D0%BD%D0%B0%D1%82%D0%BE%D0%BC%D0%B8%D1%8F)\" title=\"\u041f\u043e\u0447\u043a\u0430 (\u0430\u043d\u0430\u0442\u043e\u043c\u0438\u044f)\">\u043f\u043e\u0447\u043a\u0438<\/a> \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1953_%D0%B3%D0%BE%D0%B4\" title=\"1953 \u0433\u043e\u0434\">1953<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B1%D1%8B%D1%82%D0%B8%D1%8F_17_%D0%B8%D1%8E%D0%BD%D1%8F_1953_%D0%B3%D0%BE%D0%B4%D0%B0_%D0%B2_%D0%93%D0%94%D0%A0\" title=\"\u0421\u043e\u0431\u044b\u0442\u0438\u044f 17 \u0438\u044e\u043d\u044f 1953 \u0433\u043e\u0434\u0430 \u0432 \u0413\u0414\u0420\">\u0441\u043e\u0431\u044b\u0442\u0438\u044f 17 \u0438\u044e\u043d\u044f 1953 \u0433\u043e\u0434\u0430 \u0432 \u0413\u0414\u0420<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1955_%D0%B3%D0%BE%D0%B4\" title=\"1955 \u0433\u043e\u0434\">1955<\/a>&#160;\u2014 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u0441\u043a\u043e\u0433\u043e \u0440\u0435\u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0433\u043e \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83-104\" title=\"\u0422\u0443-104\">\u0422\u0443-104<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1967_%D0%B3%D0%BE%D0%B4\" title=\"1967 \u0433\u043e\u0434\">1967<\/a>&#160;\u2014 \u043f\u0440\u043e\u0448\u043b\u0438 \u043f\u0435\u0440\u0432\u044b\u0435 \u0438\u0441\u043f\u044b\u0442\u0430\u043d\u0438\u044f \u0432\u043e\u0434\u043e\u0440\u043e\u0434\u043d\u043e\u0439 \u0431\u043e\u043c\u0431\u044b \u0432 \u041a\u041d\u0420.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1969_%D0%B3%D0%BE%D0%B4\" title=\"1969 \u0433\u043e\u0434\">1969<\/a><ul><li>\u041d\u0430 \u043f\u043e\u0434\u043c\u043e\u0441\u0442\u043a\u0430\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%BE%D0%B4%D0%B2%D0%B5%D0%B9_(%D1%83%D0%BB%D0%B8%D1%86%D0%B0)\" class=\"mw-redirect\" title=\"\u0411\u0440\u043e\u0434\u0432\u0435\u0439 (\u0443\u043b\u0438\u0446\u0430)\">\u0411\u0440\u043e\u0434\u0432\u0435\u044f<\/a> \u043f\u0440\u043e\u0448\u043b\u0430 \u043f\u0440\u0435\u043c\u044c\u0435\u0440\u0430 \u043c\u044e\u0437\u0438\u043a\u043b\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E!_%D0%9A%D0%B0%D0%BB%D1%8C%D0%BA%D1%83%D1%82%D1%82%D0%B0!\" class=\"mw-redirect\" title=\"\u041e! \u041a\u0430\u043b\u044c\u043a\u0443\u0442\u0442\u0430!\">\u041e! \u041a\u0430\u043b\u044c\u043a\u0443\u0442\u0442\u0430!<\/a>\u00bb&#160;\u2014 \u043f\u0435\u0440\u0432\u043e\u0439 \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043a\u0438, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043d\u0430 \u0441\u0446\u0435\u043d\u0435 \u0438\u0433\u0440\u0430\u043b\u0438 \u043e\u0431\u043d\u0430\u0436\u0451\u043d\u043d\u044b\u0435 \u0430\u043a\u0442\u0451\u0440\u044b.<\/li><li>\u041f\u043e\u0431\u0435\u0434\u0438\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D1%81%D1%8F%D0%BD,_%D0%A2%D0%B8%D0%B3%D1%80%D0%B0%D0%BD_%D0%92%D0%B0%D1%80%D1%82%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041f\u0435\u0442\u0440\u043e\u0441\u044f\u043d, \u0422\u0438\u0433\u0440\u0430\u043d \u0412\u0430\u0440\u0442\u0430\u043d\u043e\u0432\u0438\u0447\">\u0422\u0438\u0433\u0440\u0430\u043d\u0430 \u041f\u0435\u0442\u0440\u043e\u0441\u044f\u043d\u0430<\/a> \u0432 \u043c\u0430\u0442\u0447\u0435 \u043d\u0430 \u043f\u0435\u0440\u0432\u0435\u043d\u0441\u0442\u0432\u043e \u043c\u0438\u0440\u0430, 10-\u043c \u0447\u0435\u043c\u043f\u0438\u043e\u043d\u043e\u043c \u043c\u0438\u0440\u0430 \u043f\u043e \u0448\u0430\u0445\u043c\u0430\u0442\u0430\u043c \u0441\u0442\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BF%D0%B0%D1%81%D1%81%D0%BA%D0%B8%D0%B9,_%D0%91%D0%BE%D1%80%D0%B8%D1%81_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0421\u043f\u0430\u0441\u0441\u043a\u0438\u0439, \u0411\u043e\u0440\u0438\u0441 \u0412\u0430\u0441\u0438\u043b\u044c\u0435\u0432\u0438\u0447\">\u0411\u043e\u0440\u0438\u0441 \u0421\u043f\u0430\u0441\u0441\u043a\u0438\u0439<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1970_%D0%B3%D0%BE%D0%B4\" title=\"1970 \u0433\u043e\u0434\">1970<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8D%D0%BD%D0%B4,_%D0%AD%D0%B4%D0%B2%D0%B8%D0%BD\" class=\"mw-redirect\" title=\"\u041b\u044d\u043d\u0434, \u042d\u0434\u0432\u0438\u043d\">\u042d\u0434\u0432\u0438\u043d \u041b\u044d\u043d\u0434<\/a> (Edwin Herbert Land) \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043b \u043a\u0430\u043c\u0435\u0440\u0443 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Polaroid\" title=\"Polaroid\">Polaroid<\/a>\u00bb.<\/li><li>\u0423\u0447\u0451\u043d\u043e\u0433\u043e-\u0431\u0438\u043e\u043b\u043e\u0433\u0430 \u0438 \u0434\u0438\u0441\u0441\u0438\u0434\u0435\u043d\u0442\u0430 45-\u043b\u0435\u0442\u043d\u0435\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%B4%D0%B2%D0%B5%D0%B4%D0%B5%D0%B2,_%D0%96%D0%BE%D1%80%D0%B5%D1%81_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041c\u0435\u0434\u0432\u0435\u0434\u0435\u0432, \u0416\u043e\u0440\u0435\u0441 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0438\u0447\">\u0416\u043e\u0440\u0435\u0441\u0430 \u041c\u0435\u0434\u0432\u0435\u0434\u0435\u0432\u0430<\/a> \u043e\u0442\u043f\u0443\u0441\u0442\u0438\u043b\u0438 \u0438\u0437 \u043a\u0430\u043b\u0443\u0436\u0441\u043a\u043e\u0439 \u043f\u0441\u0438\u0445\u0438\u0430\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0431\u043e\u043b\u044c\u043d\u0438\u0446\u044b, \u0432 \u043a\u043e\u0442\u043e\u0440\u0443\u044e \u0435\u0433\u043e \u043d\u0430\u0441\u0438\u043b\u044c\u043d\u043e \u043f\u043e\u043c\u0435\u0441\u0442\u0438\u043b\u0438 29 \u043c\u0430\u044f. \u041f\u043e \u043f\u0440\u0438\u0437\u043d\u0430\u043d\u0438\u044e \u0433\u043b\u0430\u0432\u043d\u043e\u0433\u043e \u0432\u0440\u0430\u0447\u0430 \u043f\u0441\u0438\u0445\u0431\u043e\u043b\u044c\u043d\u0438\u0446\u044b, \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0435\u043c \u0434\u043b\u044f \u043f\u0440\u0438\u043d\u0443\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0439 \u0433\u043e\u0441\u043f\u0438\u0442\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u0438 \u041c\u0435\u0434\u0432\u0435\u0434\u0435\u0432\u0430 \u043f\u043e\u0441\u043b\u0443\u0436\u0438\u043b\u0438 \u043e\u0442\u0440\u044b\u0432\u043a\u0438 \u0438\u0437 \u0440\u0443\u043a\u043e\u043f\u0438\u0441\u0435\u0439 \u0416\u043e\u0440\u0435\u0441\u0430 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0438\u0447\u0430 (\u00ab\u041a\u0443\u043b\u044c\u0442 \u043b\u0438\u0447\u043d\u043e\u0441\u0442\u0438 \u0438 \u0431\u0438\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043d\u0430\u0443\u043a\u0430\u00bb, \u00ab\u041c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0435 \u0441\u043e\u0442\u0440\u0443\u0434\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u0443\u0447\u0451\u043d\u044b\u0445 \u0438 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0435 \u0433\u0440\u0430\u043d\u0438\u0446\u044b\u00bb), \u0441 \u043a\u043e\u0442\u043e\u0440\u044b\u043c\u0438 \u043e\u043d, \u0433\u043b\u0430\u0432\u0432\u0440\u0430\u0447, \u043e\u0437\u043d\u0430\u043a\u043e\u043c\u0438\u043b\u0441\u044f \u0438 \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u00ab\u0432\u044b\u0437\u0432\u0430\u043b\u0438 \u0443 \u043d\u0435\u0433\u043e \u0441\u043e\u043c\u043d\u0435\u043d\u0438\u044f \u0432 \u043f\u0441\u0438\u0445\u0438\u0447\u0435\u0441\u043a\u043e\u043c \u0437\u0434\u043e\u0440\u043e\u0432\u044c\u0435 \u0416. \u041c\u0435\u0434\u0432\u0435\u0434\u0435\u0432\u0430\u00bb.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1972_%D0%B3%D0%BE%D0%B4\" title=\"1972 \u0433\u043e\u0434\">1972<\/a>&#160;\u2014 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u043f\u043e\u043b\u0438\u0446\u0438\u044f \u043f\u0440\u043e\u0432\u0435\u043b\u0430 \u0430\u0440\u0435\u0441\u0442 \u043f\u044f\u0442\u0438 \u0437\u043b\u043e\u0443\u043c\u044b\u0448\u043b\u0435\u043d\u043d\u0438\u043a\u043e\u0432, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0443\u0441\u0442\u0430\u043d\u0430\u0432\u043b\u0438\u0432\u0430\u043b\u0438 \u044d\u043b\u0435\u043a\u0442\u0440\u043e\u043d\u043d\u044b\u0435 \u043f\u043e\u0434\u0441\u043b\u0443\u0448\u0438\u0432\u0430\u044e\u0449\u0438\u0435 \u0443\u0441\u0442\u0440\u043e\u0439\u0441\u0442\u0432\u0430 \u0432 \u0448\u0442\u0430\u0431\u0435 \u0414\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043f\u0430\u0440\u0442\u0438\u0438 \u0432 \u0433\u043e\u0441\u0442\u0438\u043d\u0438\u0447\u043d\u043e\u043c \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441\u0435 \u00ab\u0423\u043e\u0442\u0435\u0440\u0433\u0435\u0439\u0442\u00bb, \u00ab\u0412\u0430\u0448\u0438\u043d\u0433\u0442\u043e\u043d\u00bb. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BE%D1%82%D0%B5%D1%80%D0%B3%D0%B5%D0%B9%D1%82%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%BA%D0%B0%D0%BD%D0%B4%D0%B0%D0%BB\" title=\"\u0423\u043e\u0442\u0435\u0440\u0433\u0435\u0439\u0442\u0441\u043a\u0438\u0439 \u0441\u043a\u0430\u043d\u0434\u0430\u043b\">\u0421\u043a\u0430\u043d\u0434\u0430\u043b, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0440\u0430\u0437\u0440\u0430\u0437\u0438\u043b\u0441\u044f \u0432\u0441\u043b\u0435\u0434 \u0437\u0430 \u044d\u0442\u0438\u043c<\/a>, \u043f\u043e\u043b\u043e\u0436\u0438\u043b \u043a\u043e\u043d\u0435\u0446 \u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043a\u0430\u0440\u044c\u0435\u0440\u0435 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D1%81%D0%BE%D0%BD,_%D0%A0%D0%B8%D1%87%D0%B0%D1%80%D0%B4_%D0%9C%D0%B8%D0%BB%D1%85%D0%B0%D1%83%D0%B7\" class=\"mw-redirect\" title=\"\u041d\u0438\u043a\u0441\u043e\u043d, \u0420\u0438\u0447\u0430\u0440\u0434 \u041c\u0438\u043b\u0445\u0430\u0443\u0437\">\u0420\u0438\u0447\u0430\u0440\u0434\u0430 \u041d\u0438\u043a\u0441\u043e\u043d\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1980_%D0%B3%D0%BE%D0%B4\" title=\"1980 \u0433\u043e\u0434\">1980<\/a>&#160;\u2014 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Led_Zeppelin\" title=\"Led Zeppelin\">Led Zeppelin<\/a>\u00bb \u043d\u0430\u0447\u0430\u043b\u0438 \u0442\u0440\u0451\u0445\u043d\u0435\u0434\u0435\u043b\u044c\u043d\u043e\u0435 \u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u043e\u0435 \u0442\u0443\u0440\u043d\u0435. \u041a\u0430\u043a \u043e\u043a\u0430\u0437\u0430\u043b\u043e\u0441\u044c, \u044d\u0442\u043e \u0431\u044b\u043b\u0430 \u043f\u0440\u043e\u0449\u0430\u043b\u044c\u043d\u0430\u044f \u0433\u0430\u0441\u0442\u0440\u043e\u043b\u044c \u0433\u0440\u0443\u043f\u043f\u044b, \u0442\u0430\u043a \u043a\u0430\u043a \u043f\u043e\u0441\u043b\u0435 \u0441\u043c\u0435\u0440\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BD%D1%8D%D0%BC,_%D0%94%D0%B6%D0%BE%D0%BD_%D0%93%D0%B5%D0%BD%D1%80%D0%B8\" title=\"\u0411\u043e\u043d\u044d\u043c, \u0414\u0436\u043e\u043d \u0413\u0435\u043d\u0440\u0438\">\u0414\u0436\u043e\u043d\u0430 \u0411\u043e\u043d\u044d\u043c\u0430<\/a> \u0432 \u0441\u0435\u043d\u0442\u044f\u0431\u0440\u0435 \u0442\u043e\u0433\u043e \u0436\u0435 \u0433\u043e\u0434\u0430 \u043a\u043e\u043b\u043b\u0435\u043a\u0442\u0438\u0432 \u043f\u0440\u0435\u043a\u0440\u0430\u0442\u0438\u043b \u0441\u0432\u043e\u0451 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1981_%D0%B3%D0%BE%D0%B4\" title=\"1981 \u0433\u043e\u0434\">1981<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u043d\u0430\u0447\u0430\u043b\u0441\u044f \u0441\u0443\u0434 \u043d\u0430\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B0%D0%B8%D0%BB%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%92%D0%B8%D0%BA%D1%82%D0%BE%D1%80_%D0%9B%D1%8C%D0%B2%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0411\u0440\u0430\u0438\u043b\u043e\u0432\u0441\u043a\u0438\u0439, \u0412\u0438\u043a\u0442\u043e\u0440 \u041b\u044c\u0432\u043e\u0432\u0438\u0447\">\u0412\u0438\u043a\u0442\u043e\u0440\u043e\u043c \u0411\u0440\u0430\u0438\u043b\u043e\u0432\u0441\u043a\u0438\u043c<\/a>, \u043e\u0434\u043d\u0438\u043c \u0438\u0437 \u0432\u0435\u0434\u0443\u0449\u0438\u0445 \u0435\u0432\u0440\u0435\u0439\u0441\u043a\u0438\u0445 \u0430\u043a\u0442\u0438\u0432\u0438\u0441\u0442\u043e\u0432. \u041e\u043d \u043e\u0431\u0432\u0438\u043d\u044f\u043b\u0441\u044f \u0432 \u0438\u0437\u0433\u043e\u0442\u043e\u0432\u043b\u0435\u043d\u0438\u0438 \u0441\u0430\u043c\u0438\u0437\u0434\u0430\u0442\u0441\u043a\u043e\u0433\u043e \u0436\u0443\u0440\u043d\u0430\u043b\u0430 \u00ab\u0415\u0432\u0440\u0435\u0438 \u0432 \u0421\u0421\u0421\u0420\u00bb \u0438 \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u0438\u0438 \u043a\u043e\u043b\u043b\u0435\u043a\u0442\u0438\u0432\u043d\u044b\u0445 \u043f\u0438\u0441\u0435\u043c \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0443 \u0421\u0428\u0410 \u041a\u0430\u0440\u0442\u0435\u0440\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1982_%D0%B3%D0%BE%D0%B4\" title=\"1982 \u0433\u043e\u0434\">1982<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%A2%D1%83-134_%D0%BF%D0%BE%D0%B4_%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BE%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%BE%D0%BC\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0422\u0443-134 \u043f\u043e\u0434 \u0421\u0435\u0432\u0435\u0440\u043e\u043c\u043e\u0440\u0441\u043a\u043e\u043c\">\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0422\u0443-134 \u043f\u043e\u0434 \u0421\u0435\u0432\u0435\u0440\u043e\u043c\u043e\u0440\u0441\u043a\u043e\u043c<\/a><\/li><li>\u0412 \u0432\u044b\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u0438 \u043d\u0430 \u0413\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u043e\u0439 \u0410\u0441\u0441\u0430\u043c\u0431\u043b\u0435\u0435 \u041e\u041e\u041d \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0421\u0428\u0410 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B9%D0%B3%D0%B0%D0%BD,_%D0%A0%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%B4\" title=\"\u0420\u0435\u0439\u0433\u0430\u043d, \u0420\u043e\u043d\u0430\u043b\u044c\u0434\">\u0420\u043e\u043d\u0430\u043b\u044c\u0434 \u0420\u0435\u0439\u0433\u0430\u043d<\/a> (Ronald Reagan) \u043d\u0430\u0437\u0432\u0430\u043b \u0421\u0421\u0421\u0420 \u0438\u043c\u043f\u0435\u0440\u0438\u0435\u0439 \u0437\u043b\u0430.<\/li><li>\u041f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u0432\u0435\u0440\u0442\u043e\u043b\u0451\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0-50\" title=\"\u041a\u0430-50\">\u041a\u0430-50<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1985_%D0%B3%D0%BE%D0%B4\" title=\"1985 \u0433\u043e\u0434\">1985<\/a>&#160;\u2014 \u043f\u043e\u044f\u0432\u0438\u043b\u0430\u0441\u044c \u043a\u0430\u0431\u0435\u043b\u044c\u043d\u0430\u044f \u0442\u0435\u043b\u0435\u0441\u0435\u0442\u044c \u00abDiscovery\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1988_%D0%B3%D0%BE%D0%B4\" title=\"1988 \u0433\u043e\u0434\">1988<\/a><ul><li>\u041d\u0430 \u044d\u043a\u0440\u0430\u043d\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u0432\u044b\u0448\u0435\u043b \u0444\u0438\u043b\u044c\u043c \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D0%B0%D1%8F_%D0%B6%D0%B0%D1%80%D0%B0_(%D1%84%D0%B8%D0%BB%D1%8C%D0%BC,_1988)\" title=\"\u041a\u0440\u0430\u0441\u043d\u0430\u044f \u0436\u0430\u0440\u0430 (\u0444\u0438\u043b\u044c\u043c, 1988)\">\u041a\u0440\u0430\u0441\u043d\u0430\u044f \u0436\u0430\u0440\u0430<\/a>\u00bb, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B0%D1%80%D1%86%D0%B5%D0%BD%D0%B5%D0%B3%D0%B3%D0%B5%D1%80,_%D0%90%D1%80%D0%BD%D0%BE%D0%BB%D1%8C%D0%B4\" title=\"\u0428\u0432\u0430\u0440\u0446\u0435\u043d\u0435\u0433\u0433\u0435\u0440, \u0410\u0440\u043d\u043e\u043b\u044c\u0434\">\u0410\u0440\u043d\u043e\u043b\u044c\u0434 \u0428\u0432\u0430\u0440\u0446\u0435\u043d\u0435\u0433\u0433\u0435\u0440<\/a> (Arnold Alois Schwarzenegger) \u0441\u044b\u0433\u0440\u0430\u043b \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u043c\u0438\u043b\u0438\u0446\u0438\u043e\u043d\u0435\u0440\u0430&#160;\u2014 \u0418\u0432\u0430\u043d\u0430 \u0414\u0430\u043d\u043a\u043e.<\/li><li>\u00abMicrosoft\u00bb \u0432\u044b\u043f\u0443\u0441\u0442\u0438\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%BD%D0%B0%D1%8F_%D1%81%D0%B8%D1%81%D1%82%D0%B5%D0%BC%D0%B0\" title=\"\u041e\u043f\u0435\u0440\u0430\u0446\u0438\u043e\u043d\u043d\u0430\u044f \u0441\u0438\u0441\u0442\u0435\u043c\u0430\">\u043e\u043f\u0435\u0440\u0430\u0446\u0438\u043e\u043d\u043d\u0443\u044e \u0441\u0438\u0441\u0442\u0435\u043c\u0443<\/a> \u00abMS DOS 4.0\u00bb.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1989_%D0%B3%D0%BE%D0%B4\" title=\"1989 \u0433\u043e\u0434\">1989<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%98%D0%BB-62_%D0%B2_%D0%91%D0%B5%D1%80%D0%BB%D0%B8%D0%BD%D0%B5\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0418\u043b-62 \u0432 \u0411\u0435\u0440\u043b\u0438\u043d\u0435\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0418\u043b-62 \u0432 \u0411\u0435\u0440\u043b\u0438\u043d\u0435<\/a>. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 22 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1990_%D0%B3%D0%BE%D0%B4\" title=\"1990 \u0433\u043e\u0434\">1990<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D0%B5%D0%B2\" title=\"\u041a\u0438\u0435\u0432\">\u041a\u0438\u0435\u0432\u0435<\/a> \u0441\u043e\u0437\u0434\u0430\u043d \u0421\u043e\u044e\u0437 \u00ab\u0427\u0435\u0440\u043d\u043e\u0431\u044b\u043b\u044c\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1991_%D0%B3%D0%BE%D0%B4\" title=\"1991 \u0433\u043e\u0434\">1991<\/a><ul><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%B6%D0%BD%D0%BE-%D0%90%D1%84%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u042e\u0436\u043d\u043e-\u0410\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u042e\u0436\u043d\u043e\u0439 \u0410\u0444\u0440\u0438\u043a\u0435<\/a> \u043e\u0442\u043c\u0435\u043d\u0451\u043d \u0417\u0430\u043a\u043e\u043d \u043e \u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0430\u0446\u0438\u0438 \u043d\u043e\u0432\u043e\u0440\u043e\u0436\u0434\u0451\u043d\u043d\u044b\u0445 \u043f\u043e \u0440\u0430\u0441\u043e\u0432\u043e\u043c\u0443 \u043f\u0440\u0438\u0437\u043d\u0430\u043a\u0443, \u0447\u0442\u043e \u0444\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u0438 \u043e\u0437\u043d\u0430\u0447\u0430\u043b\u043e \u0443\u043f\u0440\u0430\u0437\u0434\u043d\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BF%D0%B0%D1%80%D1%82%D0%B5%D0%B8%D0%B4\" title=\"\u0410\u043f\u0430\u0440\u0442\u0435\u0438\u0434\">\u0430\u043f\u0430\u0440\u0442\u0435\u0438\u0434\u0430<\/a> \u0432 \u044d\u0442\u043e\u0439 \u0441\u0442\u0440\u0430\u043d\u0435.<\/li><li>\u041d\u0430 \u0437\u0430\u043a\u0440\u044b\u0442\u043e\u043c \u0437\u0430\u0441\u0435\u0434\u0430\u043d\u0438\u0438 \u0412\u0435\u0440\u0445\u043e\u0432\u043d\u043e\u0433\u043e \u0421\u043e\u0432\u0435\u0442\u0430 \u0421\u0421\u0421\u0420 \u0433\u043b\u0430\u0432\u0430 \u041a\u0413\u0411 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D1%8E%D1%87%D0%BA%D0%BE%D0%B2,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041a\u0440\u044e\u0447\u043a\u043e\u0432, \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0438\u0447\">\u041a\u0440\u044e\u0447\u043a\u043e\u0432<\/a> \u0437\u0430\u044f\u0432\u0438\u043b \u043e \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u0438 \u0432 \u0441\u0442\u0440\u0430\u043d\u0435 \u043c\u0430\u0441\u0441\u044b \u00ab\u0430\u0433\u0435\u043d\u0442\u043e\u0432 \u0432\u043b\u0438\u044f\u043d\u0438\u044f\u00bb <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%B5%D0%BD%D1%82%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D0%B5_%D1%80%D0%B0%D0%B7%D0%B2%D0%B5%D0%B4%D1%8B%D0%B2%D0%B0%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D0%BE%D0%B5_%D1%83%D0%BF%D1%80%D0%B0%D0%B2%D0%BB%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0435 \u0440\u0430\u0437\u0432\u0435\u0434\u044b\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0435 \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0435\">\u0426\u0420\u0423<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1992_%D0%B3%D0%BE%D0%B4\" title=\"1992 \u0433\u043e\u0434\">1992<\/a>&#160;\u2014 \u0440\u0435\u0447\u044c \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430 \u0420\u043e\u0441\u0441\u0438\u0438 \u0411\u043e\u0440\u0438\u0441\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BB%D1%8C%D1%86%D0%B8%D0%BD,_%D0%91%D0%BE%D1%80%D0%B8%D1%81_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0415\u043b\u044c\u0446\u0438\u043d, \u0411\u043e\u0440\u0438\u0441 \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0438\u0447\">\u0415\u043b\u044c\u0446\u0438\u043d\u0430<\/a> \u0432 \u041a\u043e\u043d\u0433\u0440\u0435\u0441\u0441\u0435 \u0421\u0428\u0410. \u00ab\u0415\u043b\u044c\u0446\u0438\u043d \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u043a\u043e\u043c\u043c\u0443\u043d\u0438\u0437\u043c \u043f\u043e\u0432\u0435\u0440\u0436\u0435\u043d\u043d\u044b\u043c, \u0437\u0430\u0431\u044b\u0432 \u0443\u0442\u043e\u0447\u043d\u0438\u0442\u044c, \u0447\u0442\u043e \u0432 \u0435\u0433\u043e \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0441\u0442\u0440\u0430\u043d\u0435 \u043a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u044b \u0435\u0449\u0451 \u043e\u0441\u0442\u0430\u043b\u0438\u0441\u044c\u2026\u00bb (\u00ab\u041d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u0430\u044f \u0433\u0430\u0437\u0435\u0442\u0430\u00bb, 20 \u0438\u044e\u043d\u044f).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2000_%D0%B3%D0%BE%D0%B4\" title=\"2000 \u0433\u043e\u0434\">2000<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u043f\u0440\u043e\u0448\u043b\u0430 \u0442\u043e\u0440\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0446\u0435\u0440\u0435\u043c\u043e\u043d\u0438\u044f \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u044f \u043d\u043e\u0432\u043e\u0433\u043e \u0437\u0434\u0430\u043d\u0438\u044f \u043f\u043e\u0441\u043e\u043b\u044c\u0441\u0442\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a>. \u0414\u043b\u044f \u044d\u0442\u043e\u0433\u043e \u0432 \u0441\u0442\u043e\u043b\u0438\u0446\u0443 \u043f\u0440\u0438\u0431\u044b\u043b\u0438 \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0430\u044f \u043f\u0440\u0438\u043d\u0446\u0435\u0441\u0441\u0430 \u0410\u043d\u043d\u0430 (Anne Mountbatten-Windsor, Princess Royal) \u0438 \u043c\u0438\u043d\u0438\u0441\u0442\u0440 \u0438\u043d\u043e\u0441\u0442\u0440\u0430\u043d\u043d\u044b\u0445 \u0434\u0435\u043b \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D0%BA,_%D0%A0%D0%BE%D0%B1%D0%B8%D0%BD\" title=\"\u041a\u0443\u043a, \u0420\u043e\u0431\u0438\u043d\">\u0420\u043e\u0431\u0438\u043d \u041a\u0443\u043a<\/a> (Robert Finlayson Cook).<\/li><\/ul><h2>"}